INSERT INTO `court` VALUES (58, '0', '320000', '江苏省高级人民法院', 0, NULL, '<p>依法审判法律规定由高级人民法院管辖的刑事、民事、行政等第一、二审案件；受理不服全省各级人民法院生效裁判的各类申诉和再审申请；审理最高人民法院指令再审的各类案件；依法审判由人民检察院按照审判监督程序提出的抗诉案件；监督全省各级人民法院的审判工作；统一管理和协调全省各级人民法院的执行工作；组织、指导下级人民法院办理司法协助事项，开展同外国司法界、国际组织之间的司法交流活动。<br></p>', '210008', NULL, NULL, '江苏省高级人民法院成立于1953年，法院审判办公楼现坐落于南京市鼓楼区宁海路75号。', NULL, NULL, '12368', '<p>江苏省高级人民法院成立于1953年。新中国成立后，江苏境内有苏南人民法院、苏北人民法院和南京市人民法院3个省级的审判机构。1953年1月，中央决定撤销苏南、苏北行政公署，改南京市为省直辖市，成立江苏省人民政府。与此同时，撤销苏南、苏北人民法院，成立江苏省人民法院，后改称江苏省高级人民法院。法院审判办公楼现坐落于南京市鼓楼区宁海路75号。主要职权是：依法审判法律规定由高级人民法院管辖的刑事、民事、行政等第一、二审案件；受理不服全省各级人民法院生效裁判的各类申诉和再审申请；审理最高人民法院指令再审的各类案件；依法审判由人民检察院按照审判监督程序提出的抗诉案件；监督全省各级人民法院的审判工作；统一管理和协调全省各级人民法院的执行工作；组织、指导下级人民法院办理司法协助事项，开展同外国司法界、国际组织之间的司法交流活动。<br></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `court` VALUES (59, '0', '320100', '江苏省南京市中级人民法院', 58, NULL, '<p>南京中院下辖11个区法院、21个人民法庭，另辖江北新区人民法院、江宁经济技术开发区人民法院。全市法院实有在编干警1923名（总编制为2116），其中员额法官810名、司法辅助人员768名、司法行政人员345名，分别占总编制数的38.28%、36.29%和16.3%；全市员额法官中具有硕士、博士学位的489人，占员额法官总数的60.37%。其中，市法院实有在编干警500名（总编制为532），其中员额法官198名、司法辅助人员195名、司法行政人员107名，分别占总编制数的37.22%、36.65%和20.11%；市法院员额法官中具有硕士、博士学位的129人，占员额法官总数的65.15%。全市法院现有12名全国全省业务专家、2名全省优秀青年法学家、3名全省“333”高层次人才，24名法官被聘为大学兼职教授。2020年，全市法院受理各类案件278066件，办结247678件，同比分别下降7.9%和7.2%。其中，市法院受理32597件，办结28789件，同比分别下降13.5%和14.7%。111<br></p>', '210000', NULL, NULL, '南京市鼓楼区广州路35号', NULL, NULL, '025-83522114', '<p>南京中院下辖11个区法院、21个人民法庭，另辖江北新区人民法院、江宁经济技术开发区人民法院。全市法院实有在编干警1923名（总编制为2116），其中员额法官810名、司法辅助人员768名、司法行政人员345名，分别占总编制数的38.28%、36.29%和16.3%；全市员额法官中具有硕士、博士学位的489人，占员额法官总数的60.37%。其中，市法院实有在编干警500名（总编制为532），其中员额法官198名、司法辅助人员195名、司法行政人员107名，分别占总编制数的37.22%、36.65%和20.11%；市法院员额法官中具有硕士、博士学位的129人，占员额法官总数的65.15%。全市法院现有12名全国全省业务专家、2名全省优秀青年法学家、3名全省“333”高层次人才，24名法官被聘为大学兼职教授。2020年，全市法院受理各类案件278066件，办结247678件，同比分别下降7.9%和7.2%。其中，市法院受理32597件，办结28789件，同比分别下降13.5%和14.7%。</p><p>近年来，全市法院坚持以习近平新时代中国特色社会主义思想为指导，深入学习贯彻习近平法治思想，持续推进审判高质量发展和队伍高素质建设，各项工作稳中有进，多项工作走在全省乃至全国法院前列，受到中央军委、最高法院、国家发改委、工信部、全国妇联、江苏省委、省委政法委、省法院等的肯定和表彰，省会城市司法首位度进一步提升。中央政法委书记郭声琨、全国政协副主席汪永清、最高法院院长周强等领导先后视察南京法院，并给予充分肯定。在全国优化营商环境经验交流现场会上，市法院作为执行合同评价指标唯一代表单位介绍经验。在中央广播电视总台发布的《中国城市营商环境年度报告》中，南京的综合排名上升至第六位，其中市法院牵头主抓的执行合同、办理破产指标分列全国第三和第五。在国家发改委发布的《中国营商环境报告2020》中，我市包括执行合同、办理破产在内的12个领域单项指标进入全国前十，获评“标杆”。在中国社科院发布的司法透明度指数报告中，市法院位列全国第二，连续七年保持全国前十、全省第一。南京法院的司法改革工作受到中央司改督察组、最高法院、省司改第三方评估机构、省法院充分肯定，在全国法院司法体制改革试点工作推进会上介绍经验，2项改革经验在中央政法委召开的全国司法体制改革推进会上受到推广，2项改革经验入选最高法院司法改革案例。市法院连续两次被省法院荣记集体二等功，被确定为“全国司法公开示范法院”，并被评为全国法院刑事审判、民商事审判、知识产权审判、未成年人审判、审判监督、审判管理、司法调研、司法宣传、司法行政以及纪检监察工作先进集体。基层法院中，玄武区法院被评为全国模范法院，鼓楼区、江宁区、秦淮区法院被评为全国优秀法院，6家法院被评为“全国法院思想宣传工作先进集体”，3家法院被评为“全国优秀青少年维权岗”，高淳区法院被评为全省优秀法院，8家法院被省法院荣记集体一等功，涌现出全国十佳法官、全国优秀法官、全国法院办案标兵、江苏最美法官等一批先进典型。</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
