INSERT INTO `court` VALUES (81, '0', '320212', '江苏省江阴市人民法院', 75, NULL, '<h4><p>民商事案件按照街道管辖：澄江、城东、云亭、夏港（夏港河以东）归滨江法庭；青阳、月城归青阳法庭；徐霞客归徐霞客法庭；长泾、顾山、祝塘归长泾法庭；临港街道、璜土镇归临港经济开发区法庭；周庄镇（包括原长寿镇）归周庄法庭；华士、新桥归华士法庭</p><p>本辖区内原告不申请异地管辖的一审行政案件以及宜兴市行政区域内原告申请异地管辖的一审行政案件</p><p>本辖区内诉讼标的额在人民币500万元以下的除知识产权法院管辖的第一审知识产权民事、行政案件。</p><p>江阴市人民法院长江流域环境资源第一法庭管辖无锡市（不含宜兴市、无锡市滨湖区、无锡市新吴区），太仓市、张家港市、常熟市，常州市（不含武进区），镇江市（不含句容市）的环境资源案件。</p><p>临港经济开发区法庭为南京海事法院巡回审判基地</p><p>*所有案件立案在本部。</p></h4>', '214431', NULL, NULL, '江苏省江阴市天平路1号', NULL, NULL, '12368', '<p>江阴古称暨阳，见诸文字记载的历史有2500多年。南朝·梁绍元年（公元555年）废县置郡，建治君山之麓，因地处长江之南，遂称江阴郡，为“江阴”名称之开始。1949年4月22日江阴解放，1987年4月经国务院批准撤县建市。江阴北枕长江，与靖江市隔江相望；南近沪宁线；东接常熟、张家港；西连常州、武进，地处苏锡常“金三角”的几何中心，全市总面积987.5平方公里。</p><p>江阴市人民法院的前身是江阴县司法科，1951年1月2日，江阴县司法科改组为江阴县人民法院，院址设在原寿山路95号。1954年10月，法院分设刑事审判庭和民事审判庭。1956年，设立审判委员会。1956年8月15日，设立后塍、长泾两个人民法庭。1962年9月，设秘书室、刑事审判庭、民事审判庭和长泾人民法庭。“文化大革命”期间，司法业务由中国人民解放军江阴县公检法军事管制委员会掌管。1973年9月，恢复江阴县人民法院，设秘书室、刑事审判庭和民事审判庭，办公地点在高巷8号。1975年5月22日，中共江阴县委决定恢复和设立长泾、青阳、华士、澄西四个人民法庭。1980年8月1日，增设要塞人民法庭。1982年5月，设立经济审判庭。1983年3月，法院党组成立。1984年8月，法院搬入虹桥南路办公大楼。1987年7月28日，增设城郊、璜塘、祝塘人民法庭。1987年，江阴撤县建市，法院改称江阴市人民法院。1987年10月，设立执行庭。1988年8月，设立告诉申诉审判庭、行政审判庭、周庄人民法庭、澄江人民法庭。1990年11月，设立政工科。1994年6月28日，法院办公大楼易地重建后落成，地址在澄江中路5号。1995年10月，司法警察队成立，1997年5月，更名为司法警察大队。1997年1月，设立滨江人民法庭。1999年10月，设立监察室，同年，滨江人民法庭撤销。2000年7月，告诉申诉审判庭撤销，分设立案庭和审判监督庭。2003年7月，璜塘人民法庭和祝塘人民法庭撤销，原辖区划归青阳人民法庭；撤销澄江人民法庭、要塞人民法庭、南闸人民法庭，合并设立滨江人民法庭。&nbsp;2003年，新设少年审判庭、司法鉴定室。同年，民事审判庭更名为民事审判第一庭，经济审判庭更名为民事审判第二庭，执行庭更名为执行局。自&nbsp;2003年3月起，新审判综合大楼开始建设，工程历时二年零二个月。2005年6月1日，新审判综合大楼正式启用，地址在天平路1号。2019年6月，江阴法院根据上级要求进行内设机构改革，改革后，江阴法院设置立案庭、刑事审判庭、民事审判第一庭、民事审判第二庭、行政审判庭、知识产权审判庭、速裁审判庭、执行局、审判管理办公室、政治部、综合办公室、司法行政装备科等12个内设机构。保留司法警察大队，作为江阴市人民法院直属行政机构。保留江阴市人民法院滨江人民法庭、临港经济开发区人民法庭、长泾人民法庭、周庄人民法庭、华士人民法庭、青阳人民法庭、徐霞客人民法庭这7个人民法庭作为江阴法院派出机构。</p><p>多年来，江阴法院在市委的正确领导、市人大的监督下，在上级法院的正确指导下，紧紧围绕党和国家工作大局，坚持“公正司法、司法为民”指导方针和公正与效率主题，认真履行宪法和法律赋予的神圣职责。全院干警同心同德，艰苦奋斗，奋力拼搏，服务大局抓审判，突出重点抓基层，围绕公正抓队伍，开拓创新抓改革，努力让人民群众在每一个司法案件中感受到公平正义，各项工作不断取得新进展，在审判业务、队伍建设、法院改革等方面取得了显著成绩，为建设平安江阴、法治江阴做出了应有贡献，受到了党委、政府、上级机关和人民群众的好评，获得多项荣誉并受到上级表彰。</p><p>回首奋斗征程，江阴市人民法院不断发展壮大，在促进建设有中国特色社会主义事业，保障经济高质量发展以及维护社会稳定等方面取得了显著的业绩，为全面推进依法治国,加快建设社会主义法治国家提供了有力的司法保障。</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
