INSERT INTO `court` VALUES (88, '0', '320303', '徐州市云龙区人民法院', 86, NULL, '<p>云龙辖区面积118平方公里，辖区人口40余万。<br></p>', '221000', NULL, NULL, '徐州市三环东路66号', NULL, NULL, '0516-67667011', '<p>&nbsp; &nbsp; &nbsp; &nbsp;徐州市云龙区人民法院成立于1955年12月，法院现有审判办公大楼建成于2000年6月，坐落于徐州市三环东路66号。云龙辖区面积118平方公里，辖区人口40余万。全院现有人员264人，其中正式在编人员114人，员额法官37人。拥有本科以上学历干警192人，硕士研究室25人，占总人数的82.2%,法院队伍呈现出知识化、年轻化、专业化的特点。<br><br>　　云龙法院现设有刑事审判庭、民事审判第一庭、民事审判第二庭（执行裁判庭）、少年及家事审判庭（行政审判庭）、执行局（执行指挥中心）、立案庭（诉讼服务中心）、审判管理办公室（审判监督庭、研究室）、政治部、综合办公室以及司法行政装备科共10个职能部门，同时保留司法警察大队作为徐州市云龙区人民法院直属行政机构。<br><br>　　近年来，云龙法院坚持以习近平新时代中国特色社会主义思想为指引，牢固树立社会主义法治理念，坚持党建引领，服务工作大局，优化营商环境，为创建平安云龙、法治云龙、幸福云龙提供了有力的司法保障。同时，云龙法院还还积极推行“党建+特色审判”，先后形成了少年审判、司法拥军、老年维权等多项司法品牌，得到了上级领导和社会各界的一致认可。<br><br>　　因工作成绩突出，云龙法院多次被授予“人民满意法院”、“文明法院”，并先后荣立集体一等功2次、集体二等功2次，并被评为省级“文明单位”。司法拥军工作入选“徐州市第三届法治事件”，并得到了驻苏部队人大代表李克让等四位将军的高度评价。此外，院民一庭被全国老龄委评为“敬老文明号”。少年家事庭先后被评为“全国青少年优秀维权岗”、省级“巾帼文明岗”等。同时，云龙法院还涌现如全国少年审判工作先进个人王颖、全省法院监察系统先进个人陈雪娣、全省法院执行工作先进个人赵艳丽等一大批先进个人。&amp;nbsp;&nbsp;&nbsp;<br></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
