INSERT INTO `court` VALUES (136, '0', '320800', '江苏省淮安市中级人民法院', 58, NULL, '<p>下辖法院：</p><p>淮安经济技术开发区人民法院<br></p><p>淮安市清江浦区人民法院<br></p><p>淮安市淮阴区人民法院<br></p><p>淮安市淮安区人民法院</p><p>淮安市洪泽区人民法院</p><p>涟水县人民法院<br></p><p>金湖县人民法院<br></p><p>盱眙县人民法院<br></p><p><br></p>', '223001', NULL, NULL, '江苏省淮安市清江浦区翔宇中道152号', NULL, NULL, '051712368', '<p>淮安是一代伟人周恩来家乡，地处长江三角洲北部，总面积1.003万平方公里，户籍人口561.33万人，辖三县（涟水、盱眙、金湖）四区（清江浦、淮安、淮阴、洪泽）以及淮安经济技术开发区、淮安工业园区、淮安生态文旅区，拥有国家历史文化名城、国家卫生城市、国家园林城市、国家环保模范城市、中国优秀旅游城市、中国淮扬菜之乡、中国运河之都等称号。</p><p>淮安具有悠久的革命历史，曾是苏皖边区政府的驻地，淮安法院传承了革命的红色基因，历史可追溯到1941年10月正式成立的淮海专署抗日民主政权司法科和1942年6月成立的淮海区高级法院，距今已有近79年的历史。目前，淮安共有8家基层人民法院、17个派出人民法庭。全市法院有政法专项编制1212名，实有正式在编干警1089名，其中员额法官395名，占政法专项编制数的32.59%。市法院有政法专项编制218名，实有在编干警206名，其中员额法官79名，占政法专项编制数的36.24%。</p><p>近年来，淮安两级法院坚持司法为民、公正司法工作主线，主动服务保障大局，深入推进司法改革，不断加强队伍建设，各项工作取得新进展。市法院被最高人民法院表彰为“司法公开示范法院”“案例工作先进集体”“司法行政工作先进集体”“党建工作先进集体”，连续两次被省委、省政府表彰为“全省社会治安综合治理先进集体”。</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
