INSERT INTO `court` VALUES (182, '0', '321112', '江苏省句容市人民法院', 178, NULL, '<p>1995年4月6日，句容撤县设市，句容县人民法院更名为句容市人民法院。句容市人民法院已拥有190余名干警，内设监察室、办公室、政治处、研究室、行装科、法警大队、刑庭、民一庭、民二庭、行政庭、执行局、立案庭、审监庭、审管办、司法鉴定办公室等18个部门和下蜀法庭、后白法庭2个基层人民法庭。&nbsp;&nbsp;<br></p>', '212400', NULL, NULL, '句容市文昌中路', NULL, NULL, '0511-87996111', '<p>江苏省句容市人民法院的前身是成立于1951年的句容县人民法院，是一个地方行政单位。&nbsp; 2009至2013年，句容法院共审理、执行各类案件47234件，结案标的总额为38.54亿元。其中，审结刑事案件1822件，判处人犯2757人；审结民商事案件33100件，解决争议标的24.57亿元；审结行政诉讼案件177件，依法审查行政执行案件277件；执结案件11858件，执结标的13.97亿元。经过六十多年的努力奋斗，在切实履行审判职责，使“公正司法、为民司法”理念日益深入人心的同时，句容法院在审判业绩、队伍建设、基础设施等方面飞速发展，年结案近万件，已成为维护社会公平正义、保障群众合法权益、促进经济社会发展的重要力量。因工作突出，近年来该院曾获得全省优秀法院、镇江市优秀法院、全省法院社会管理创新先进集体、审判绩效先进集体、涉诉矛盾纠纷化解工作先进集体、新闻宣传工作先进集体、镇江市跨越发展有功单位、句容市文明单位等多项荣誉。<br></p>', '119.158807', '31.958012', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
