INSERT INTO `court` VALUES (197, '0', '321303', '江苏省泗阳县人民法院', 194, NULL, '<p>辖区范围达到1418平方公里，包括16个乡镇、3个街道、2个场（农场、泗阳棉花原种场）、1个省级经济开发区、238个行政村。&nbsp;&nbsp;<br></p>', '223800', NULL, NULL, '泗阳县北京中路12号', NULL, NULL, '0527-12368', '<p>泗阳历史悠久，有5000年文明史和2236年建县史，是西汉时期古泗水国都邑所在地，也是中国八大名酒洋河大曲的发源地，古往今来有“泗水古国、美酒之都、杨树之乡、平原林海、世外桃源”的美誉。泗阳地处江苏省北部，坐落在风光秀丽的洪泽湖畔，古老的京杭大运河穿城而过，沿河风光带十里春风，观赏居住两相宜，是千里运河之上的最美岸线。随着经济社会发展，全县形成了以板材、酿酒、新能源、装备、家具、纺织、照明等绿色产业为主导的工业增长极和以高效生态农业为特色的经济发展格局。先后荣获全国绿化模范县、生态建设模范县、最佳生态宜居县，国家卫生县城、全国文明县城，苏北唯一的“书香之县”，也是全国首批国家绿色能源示范县和全国平安建设先进县。</p><p>&nbsp; &nbsp; 泗阳法院成立于1949年10月1日，现坐落于泗阳县北京中路12号，管辖泗阳县行政区域内的刑事、民事、经济、执行等各类案件。辖区范围达到1418平方公里，包括16个乡镇、3个街道、2个场（农场、泗阳棉花原种场）、1个省级经济开发区、238个行政村。全县总人口103.3万，其中常住人口30.2万。2017年以来，全县上下紧紧围绕“江苏生态大公园”定位和“两聚一高”目标任务，加快发展方式转变和动力转换，泗阳法院立足县情实际，坚持司法为民，公正司法，依法服务经济社会发展，各项工作取得新成效、新突破。</p><p>&nbsp; &nbsp; 泗阳法院现有内设机构主要包括刑庭、民一庭、民二庭、少年及家事审判庭、立案庭、审管办、执行局等审判业务庭，政治处、监察室、办公室、行政装备科、法警大队等综合部门，王集法庭、新袁法庭、开发区法庭3个派出法庭。全院编制人数123人，现有在编人员121人，员额法官43人，在编法官助理、书记员49人，司法行政人员16人，司法警察13人，聘用制合同人员128名。其中硕士研究生4名，大学本科生112名。大学本科以上人数占全院在编人员的比例为92.6%，法院队伍呈现出知识化、年轻化、专业化的特点。</p><p>&nbsp; &nbsp; 建院以来，泗阳法院的收案数每年都呈现出大幅度上升的态势，2017年受理案件数首次破2万件，达到21388件，审执结17702件，同比分别增长23.43%，34.69%。面对案多人少的突出矛盾和审判任务繁重的严峻形势，在院党组的正确领导下，在县人大及其常委会和上级法院的监督指导下，泗阳法院紧紧围绕“努力让人民群众在每一个司法案件中都感受到公平正义”的目标，围绕推进社会矛盾化解、司法改革、队伍建设三项重点工作，切实履行宪法和法律赋予的职责，弘扬“厚德行健，明律善断”泗阳法院精神，工作业绩和工作水平不断提升，队伍整体素质明显提高。泗阳法院曾多次被评为江苏省优秀法院，并获得江苏省法院改革开放三十周年英模先进集体、江苏省法院基层基础建设先进单位、江苏省法院涉诉矛盾纠纷化解工作先进集体、司法公开示范法院和江苏省政法系统公正廉洁执法先进集体等各类荣称号。刘向远同志被中共中央政法委表彰为全国政法系统优秀党员干警。近两年来，全院更是涌现出了全国法院司法警察先进个人、全省法院司法警察业务能手、优秀党务工作者谢振实，全省法院优秀共产党员、个人一等功、优秀女法官者杨菁，全省法院监察系统先进个人周川红，全省优秀法庭庭长邢军等先进个人；还涌现出省级巾帼文明岗刑庭、执行工作先进集体执行局、全省法院系统先进集体新袁法庭等先进集体；法院也先后被表彰为党的十九大安保维稳先进集体、市文明单位、政法工作先进单位。</p><p>&nbsp; &nbsp; “潮平岸阔催人进，风起扬帆正当时。”面对新时代新形势新要求，泗阳法院将深入学习贯彻党的十九大精神，以习近平新时代中国特色社会主义思想为指引，坚持“司法为民，公正司法”主线不动摇，努力让人民群众在每一个司法案件中都感受到公平正义，为决胜全面小康提供更加有力的司法保障。&nbsp;</p><p>&nbsp;&nbsp;&nbsp;<br></p>', '118.705820', '33.720681', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
