INSERT INTO `court` VALUES (674, '0', '510703', '绵阳市游仙区人民法院', 664, NULL, '<p>游仙区</p>', '621000', NULL, NULL, '绵阳市游仙区游仙路188号', NULL, NULL, '0816-2291035', '<p>游仙，三国故地，古绵治所，位于巴蜀腹地、涪江以东，因东汉高士李意期仙游此地而得名。游仙是1993年1月经国务院批准的县级行政区，是中国科技城核心区、绵阳市主城区，是中国西部唯一的绿色产业示范区，是四川省乡村旅游示范区，是“四川黄金旅游九环线”和“川陕三国精品旅游线路”的重要节点，辐员面积1018平方公里，辖1个经济开发区、1个经济试验区、3个街道、8个乡镇，55个社区、226个村，总人口56.83万。</p><p>游仙区人民法院成立于1993年2月，现有内设机构8个和司法警察大队，人民法庭3个，正式干警80人（政法专项编制71人、工勤人员9人），女干警36人，40岁以下干警39人，研究生7人，占总人数的7.5%，大学67人，占总人数的93.75%，员额法官27名，辅助人员33名，行政人员11名，三类人员占政法专项编制比例分别为38%、46.5%、15.5%。2015年1月，游仙法院审判大楼建成并投入使用，结束建院22年无审判大楼的历史，年均审执结各类案件6000余件。</p><p>近年来，游仙区人民法院在区委的坚强领导下，在区人大和上级法院的有力监督指导下，在区政府的大力支持下，在区政协的民主监督及社会各界的关心帮助下，高举习近平新时代中国特色社会主义思想伟大旗帜，增强“四个意识”、坚定“四个自信”、做到“两个维护”，紧紧围绕区委重大决策部署，不忘初心、牢记使命，忠实履行宪法和法律赋予的职责，奋力推动各项工作取得新进展。先后荣获四川省法院系统集体二等功、四川省法院系统先进集体、四川省学法用法示范机关、绵阳市基层党建“3+2”书记项目示范党组织、全市法院集体三等功等荣誉140余项，连续两年位居全市法院目标考核第一名并荣获综合特等奖，连续三年荣获游仙区创新担当特别贡献先进集体，得到上级法院、党委政府和人民群众的高度肯定。</p><p>初心如磐，使命在肩。在新的征程上，游仙法院人将以习近平新时代中国特色社会主义思想为指导，紧紧围绕“努力让人民群众在每一个司法案件中感受到公平正义”工作目标和经济社会发展主要目标，更加有效地维护司法公正，更加有力地服务改革发展，更加全面地保障群众权益，更加严格地抓好队伍建设，为谱写更高质量的“五个游仙”建设新篇章提供更加有力的司法保障。</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
