henUsed=\"false\" QFormat=\"true\" Name=\"Book Title\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]-->\r\n\r\n<!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:普通表格;\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.5pt;\r\n	mso-bidi-font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-font-kerning:1.0pt;}\r\n</style>\r\n<![endif]-->\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><span lang=\"EN-US\" style=\"font-size:14.0pt;\r\nmso-ascii-font-family:宋体;mso-ascii-theme-font:minor-fareast;mso-fareast-font-family:\r\n宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:宋体;mso-hansi-theme-font:\r\nminor-fareast;color:#2F2F2F\">&nbsp;&nbsp;&nbsp;</span><span style=\"font-size:\r\n14.0pt;mso-ascii-font-family:宋体;mso-ascii-theme-font:minor-fareast;mso-fareast-font-family:\r\n宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:宋体;mso-hansi-theme-font:\r\nminor-fareast;color:#2F2F2F\">凉山彝族自治州中级人民法院共有<span lang=\"EN-US\">19</span>个办事机构，既：办公室、政治部（下设组织人事处、法官管理处、宣传教育培训处）、立案庭、刑事审判第一庭、刑事审判第二庭、民事审判第一庭、民事审判第二庭、民事审判第三庭、环境资源审判庭、行政审判庭、审判监督庭、执行局（庭）（下设案件执行处、综合处）、政策法律研究室、审判管理办公室、司法警察支队（下设直属大队）、司法行政装备管理处（下设技术室）、督察室、机关党委（机关纪委）、离退休人员工作处。近年来，凉山彝族自治州中级人民法院以习近平新时代中国特色社会主义思想为指引，深入贯彻习近平法治思想，始终坚持党对法院工作的绝对领导，坚持公正司法、司法为民，以“努力让人民群众在每一个案件中感受到公平正义”为目标。牢牢把握新时代赋予人民法院的新使命，不忘初心、牢记使命、砥砺前进，以高度的政治责任感和历史使命感，忠实履行宪法和法律赋予的职责，不断强化司法能力建设、司法作风建设和司法廉政建设；以全面深化司法体制改革为契机，加大对全州基层人民法院班子协管力度，提高班子整体运行效能；精准科学选人用人，完善人才选荐机制，选优配强干部；坚持育用结合，进一步健全完善干部交流、上挂、下派制度，切实做好优秀年轻干部培养；以监督管理为重点，从审判质量、效率、流程、层级和绩效等五个方面，创新完善审判管理，建立审务督察制度，促进制度建设常态化。通过配强班子、选准干部、建好队伍、打牢基础、聚集人才等举措，锻造出一支政治坚定、业务精髓、执法公正、作风优良的凉山“政法铁军”。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
