INSERT INTO `court` VALUES (894, '0', '330402', '嘉兴市南湖区人民法院', 893, NULL, '<h2>&nbsp; 南湖区一审刑事、民事、行政和执行案件，经开区城南街道、长水街道一审民事和执行案件。</h2>', '314001', NULL, NULL, '嘉兴市南湖区望湖路616号（南湖区公安分局东侧）', NULL, NULL, '0573-12368', '<h1 style=\"text-indent:32.0pt;mso-char-indent-count:2.0;\nline-height:29.0pt;mso-line-height-rule:exactly\"><br></h1><p><br></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;\nline-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;\nfont-family:宋体;mso-ascii-theme-font:major-fareast;mso-fareast-theme-font:major-fareast;\nmso-hansi-theme-font:major-fareast\">南湖法院</span><span style=\"font-size:16.0pt;\nfont-family:宋体;mso-ascii-theme-font:major-fareast;mso-fareast-theme-font:major-fareast;\nmso-hansi-theme-font:major-fareast;mso-bidi-font-family:&quot;Times New Roman&quot;\">现有各类工作人员<span lang=\"EN-US\">193</span>人，其中政法专项编制数<span lang=\"EN-US\">98</span>名，实有<span lang=\"EN-US\">92</span>人；事业编制数<span lang=\"EN-US\">15</span>名，实有<span lang=\"EN-US\">15</span>人；合同制辅助人员<span lang=\"EN-US\">86</span>人（含聘用制法官助理<span lang=\"EN-US\">8</span>人）。员额法官编制<span lang=\"EN-US\">49</span>人，实有<span lang=\"EN-US\">46</span>人。行政事业编制人员中，<span lang=\"EN-US\">35</span>周岁以下干警占比<span lang=\"EN-US\">44.23%</span>，大学本科学历及以上占比<span lang=\"EN-US\">97.12%</span>，其中研究生学历占<span lang=\"EN-US\">31.77%</span>。领导班子成员<span lang=\"EN-US\">7</span>人，其中党组书记、院长<span lang=\"EN-US\">1</span>人，副院长<span lang=\"EN-US\">3</span>人，派驻纪检组长<span lang=\"EN-US\">1</span>人，执行局局长<span lang=\"EN-US\">1</span>人，政治部主任<span lang=\"EN-US\">1</span>人。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;\nline-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;\nfont-family:宋体;mso-ascii-theme-font:major-fareast;mso-fareast-theme-font:major-fareast;\nmso-hansi-theme-font:major-fareast;mso-bidi-font-family:&quot;Times New Roman&quot;\"><br></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;\nline-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;\nfont-family:宋体;mso-ascii-theme-font:major-fareast;mso-fareast-theme-font:major-fareast;\nmso-hansi-theme-font:major-fareast;mso-bidi-font-family:&quot;Times New Roman&quot;\">现有内设机构<span lang=\"EN-US\">11</span>个，即立案庭（诉讼服务中心）、刑事审判庭、民事审判一庭、民事审判二庭、民事审判三庭（知识产权审判庭）、行政审判庭（综合审判庭）、执行局、审判管理办公室（研究室）、政治部、综合办公室、司法警察大队，并设下属事业单位审判保障服务中心，另有凤桥、新丰、嘉兴科技城、长水<span lang=\"EN-US\">4</span>个派出法庭。法院设机关党委，下属党支部<span lang=\"EN-US\">15</span>个，在职党员<span lang=\"EN-US\">82</span>名。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;\nline-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;\nfont-family:宋体;mso-ascii-theme-font:major-fareast;mso-fareast-theme-font:major-fareast;\nmso-hansi-theme-font:major-fareast;mso-bidi-font-family:&quot;Times New Roman&quot;\"><br></span></p><p>\n\n\n<!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing>\n  <w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery>\n  <w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>ZH-CN</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:SpaceForUL/>\n   <w:BalanceSingleByteDoubleByteWidth/>\n   <w:DoNotLeaveBackslashAlone/>\n   <w:ULTrailSpace/>\n   <w:DoNotExpandShiftReturn/>\n   <w:AdjustLineHeightInTable/>\n   <w:BreakWrappedTables/