INSERT INTO `court` VALUES (927, '0', '330822', '常山县人民法院', 2103, NULL, '<p>.</p>', '324200', NULL, NULL, '浙江省常山县天马街道白马路155号', NULL, NULL, '12368', '<p>常山县位于浙江省西部，钱塘江源头，东邻柯城区，南连江山市，西接江西省玉山县，北通开化县，东北与淳安县接壤。全县总面积1099.1平方公里，人口33.2万。常山历史悠久，东汉建安二十三年（公元218年）建县，始称定阳，建县已近1800年的历史。<br>&nbsp;&nbsp;常山县人民法院成立于1950年。现内设政治处、办公室、审判保障中心、监察室、刑事审判庭、民事审判第一庭、民事审判第二庭、行政审判庭、立案庭、审判监督庭、审判管理办公室、执行局（执行庭、执行裁决庭）、司法警察大队等14个职能部门，下辖芳村人民法庭、红旗岗人民法庭、交通巡回法庭。截止2014年12月，在职干警87人。半个多世纪以来，该院曾四迁院址，现审判办公综合楼位于县城天马镇白马路155号，2004年投入使用，占地16亩，大楼气势宏伟，为常山县城标志性建筑。<br>&nbsp;&nbsp;近年来，常山法院坚持以科学发展观为指导，认真贯彻党的十八大精神，按照“努力让人民群众在每一个司法案件中都感受到公平正义”的目标，紧紧围绕“实力工业、休闲城市、美丽乡村”发展战略，深化落实“八项司法”，遵循“从严治院、公信立院、科技强院、文化兴院”方针，大力弘扬“尚法、敬德、慎行、守廉”的常山法院机关精神，抓班子带队伍，抓审判强职能，抓管理提质效，队伍素质、审判质量和司法公信力不断提升，为本地经济社会科学发展提供了有力的司法保障。先后获得了全省优秀法院、全省阳光司法优秀法院、全省政法系统“学枫桥、保平安、促发展”先进集体、集中清理涉诉信访积案先进集体、综合治理执行难先进法院以及全省法院刑事审判工作先进集体、司法政务工作先进集体、优秀司法警察大队等多项荣誉。 司法服务热线：12368 法院所在地：浙江省常山县天马街道白马路155号 邮编：324200 公交线路：乘坐1路公交车“国土局站”下向西步行20米；乘坐5路公交车“工商局站”下向东步行30米。</p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\"false\"  DefUnhideWhenUsed=\"true\"  DefSemiHidden=\"true\"  DefQFormat=\"false\"  DefPriority=\"99\"  LatentStyleCount=\"260\" >\r\n<w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Normal\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 1\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 2\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 3\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 4\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 5\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 6\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\"  Priority=\"9