INSERT INTO `court` VALUES (2707, '0', '412322', '商丘市睢阳区人民法院', 2704, '', '', '', '', '', '', '8:30-18:00', '12368', '0370-3215294', '商丘市睢阳区是1997年在原县级商丘县的基础上设立的县级行政区，是商丘市委、市政府所在地，是全市的政治、经济、文化中心，是国家历史文化名城、中国优秀旅游城市。全区辖18个乡镇（办事处），总人口81万，面积960平方公里，其中城区面积44平方公里。   \r\n\r\n    商丘市睢阳区人民法院位于北海路182号。其前身是商丘县人民法院，成立于1952年2月。1997年12月商丘撤地设市，原商丘县人民法院更名为商丘市睢阳区人民法院。\r\n\r\n    商丘市睢阳区人民法院现有干警131人，其中，法官86人，书记员23人，司法警察5人，司法行政人员16人。内设立案庭等10个机关业务庭、办公室等8个司法行政部门、新城法庭等7个派出人民法庭、小额速裁合议庭等8个新型审判团队。主要担负全区的刑事、民商事、行政案件的审理与执行，积极参与社会治安综合治理等多项工作。2014年至2016年共审（执）各类案件22445件，较好地发挥了人民法院惩治犯罪、调处纠纷、化解矛盾、维护稳定、促进发展的职能作用。\r\n\r\n    近年来，该院党组以公正司法、司法为民为工作主线，以“让人民群众在每一个司法案件中感受到公平正义”为工作要求，以争创“全国一流法院、全国文明单位”为工作目标，充分履行审判执行职能，各项工作驶入了快车道，并取得优异的成绩。院连续五年在上级法院的绩效考核中名列前茅，连续五年荣获“全省先进基层法院”，连续五年在群众满意度调查中位居全省164个基层法院前十名。', '', '', '', '1', '/Uploads/ftfb/5ba0bd4324f0a.jpg', '2174', NULL, NULL, NULL, NULL);
