INSERT INTO `court` VALUES (3950, '0', '610221', '铜川市耀州区人民法院', 3947, NULL, '<p>管辖12个乡镇，４个街道办事处，218个行政村，８个社区委员会。&nbsp;&nbsp;<br></p>', '727100', NULL, NULL, '陕西省铜川市耀州区天宝路街道华祥路', '', NULL, '0919-2850789', '<p><span lang=\"EN-USArial&quot;,&quot;sans-serif&quot;;\" color:#333333\'=\"\">&nbsp; &nbsp; &nbsp; 铜川市</span><span style=\"font-size:12.5pt;mso-ascii-font-family:\r\nArial;mso-hansi-font-family:Arial;mso-bidi-font-family:Arial;color:#333333\">耀州区人民法院成立于</span><span lang=\"EN-USArial&quot;,&quot;sans-serif&quot;;color:#333333\'\">1949</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">年</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">8</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">月，位于铜川市耀州区华祥路，是依法成立的国家审判机关，担负铜川市耀州区辖区内的各类案件的一审工作。</span><span lang=\"EN-USArial&quot;,&quot;sans-serif&quot;;color:#333333\'\"><o:p></o:p></span></p><p><span lang=\"EN-USArial&quot;,&quot;sans-serif&quot;;\" color:#333333\'=\"\">&nbsp; &nbsp; &nbsp; </span><span style=\"font-size:12.5pt;\r\nmso-ascii-font-family:Arial;mso-hansi-font-family:Arial;mso-bidi-font-family:\r\nArial;color:#333333\">现有中央政法专项编制</span><span lang=\"EN-US\" style=\"font-size:12.5pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#333333\">48</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">人，内设机构</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">8</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">个，分别是立案庭（诉讼服务中心）、刑事审判庭、民事审判庭、综合审判庭、执行局（执行指挥中心）、政治部、综合办公室、审判管理办公室。派出法庭五个：泥阳人民法庭、小丘人民法庭、庙湾人民法庭、石柱人民法庭、关庄人民法庭。</span><span lang=\"EN-USArial&quot;,&quot;sans-serif&quot;;color:#333333\'\">2022</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">年收各类案件</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">3672</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">件，结案</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">3528</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">件。同比分别下降1.53</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">%</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">、1.04</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">%</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">，案件结收比实现</span>1.01<span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">目标。</span></p><p><span lang=\"EN-USArial&quot;,&quot;sans-serif&quot;;\" color:#333333\'=\"\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-size:12.5pt;\r\nmso-ascii-font-family:Arial;mso-hansi-font-family:Arial;mso-bidi-font-family:\r\nArial;color:#333333\">近年来，耀州区人民法院紧紧围绕工作大局，全面加强审判和执行工作，以公正高效的审判活动，连续六年荣获</span><span lang=\"EN-USArial&quot;,&quot;sans-serif&quot;;color:#333333\'\">“</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">全区目标责任考核优秀单位</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">”</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">，先后荣获全国</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">“</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">立案信访窗口建设先进集体</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">”</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">称号、全省</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">“</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">无执行积案先进法院</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">”</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">、审判</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">“</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">五进</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">”</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">先进集体，全市</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">“</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">人民满意的政法单位</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\">”</span><span style=\"font-size:12.5pt;mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;\r\nmso-bidi-font-family:Arial;color:#333333\">标兵等称号。</span><span lang=\"EN-US\" arial\",\"sans-serif\";color:#333333\'=\"\"><o:p></o:p></span></p><p>\r\n\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:DrawingGridV